def _clone_functional_model(model, input_tensors=None):
    if not isinstance(model, Model):
        raise ValueError('Expected `model` argument to be a `Model` instance, got ', model)
    if isinstance(model, Sequential):
        raise ValueError('Expected `model` argument to be a functional `Model` instance, got a `Sequential` instance instead:', model)

    layer_map = {}  # Cache for created layers
    tensor_map = {}  # Map {reference_tensor: (corresponding_tensor, mask)}

    if input_tensors is None:
        input_tensors = [Input(batch_shape=layer.input.shape, dtype=layer.input.dtype) for layer in model._input_layers]

    for original, cloned in zip(model._input_layers, input_tensors):
        layer_map[original] = cloned

    tensor_map = dict(zip(model.inputs, input_tensors))

    depth_keys = list(model._nodes_by_depth.keys())
    depth_keys.sort(reverse=True)
    for depth in depth_keys:
        nodes = model._nodes_by_depth[depth]
        for node in nodes:
            # Recover the corresponding layer
            layer = node.outbound_layer

            # Get or create layer
            if layer not in layer_map:
                # Clone layer
                new_layer = layer.__class__.from_config(layer.get_config())
                layer_map[layer] = new_layer
            else:
                # Reuse previously cloned layer
                layer = layer_map[layer]
                # Don't call InputLayer multiple times
                if isinstance(layer, InputLayer):
                    continue

            # If all previous input tensors are available in tensor_map,
            # then call node.inbound_layer on them
            computed_data = [tensor_map[x] for x in node.input_tensors]

            if len(computed_data) == len(node.input_tensors):
                # Call layer
                if node.arguments:
                    kwargs = node.arguments
                else:
                    kwargs = {}

                output_tensors = to_list(layer(computed_data, **kwargs))

                # Update tensor_map
                tensor_map.update(zip(node.output_tensors, output_tensors))

    # Check that we did compute the model outputs,
    # then instantiate a new model from inputs and outputs
    output_tensors = [
        tensor_map[x]
        for x in model.outputs
    ]

    return Model(input_tensors, output_tensors, name=model.name)
